import React from 'react'

class Detail extends React.Component {

    render() {
        console.log(this.props)
        const user = this.props.location.currUser;
        console.log(user)
        return (
        <div className="container">
            <div className="row">
                <h1>{user['first_name']}</h1>
            </div>
            <p>Details{user['id']}</p>
        </div>
        );
    }
}

export default Detail;
